import React from "react";
import Particles from "react-particles-js";
import ParticleOption from "./Particles";

const ParticlesBackground = () => {
  return (
    <div>
      <Particles params={ParticleOption}></Particles>
    </div>
  );
};

export default ParticlesBackground;
